@keyframes pseudoScroll {
  0% {
    opacity: 0;
    left: 30px;
  }
  50% {
    opacity: 1;
    left: 60px;
  }
  100% {
    opacity: 0;
    left: 90px;
  }
}

.pseudo-scroll {
  position: relative;
  padding: 0 25px;

  &__line,
  &__line-active {
    height: 4px;
    border-radius: 3px;
  }
  &__line {
    position: relative;
    background-color: #dde3eb;
